"use strict";new Vue({el:".team_main",data:{list:[]},created:function(){this.getList()},methods:{getList:function(){var i=this;axios({method:"get",url:"https://derway.tw/admin/api/members"}).then(function(t){var e=0<t.data.data.length?t.data.data:[];i.list=[],e.forEach(function(t){i.list.push({id:t.id,name:t.name,education:t.education,experience:t.experience,position:t.position,image:t.filename})})}).catch(function(){alert("最新消息列表取得失敗！")})}}});